'use strict';
let MessageType = require('./MessageType.js');
//@@DocBrief("The class for getting instrument subscribing statuss")
class InstrumentSubscribingStatusMessage {
    offerId;
    error;
    requestId;
    subscribed;
    constructor() {
        this.offerId = null;
        this.error = null;
        this.requestId = null;
        this.subscribed = false;
    }
    isSubscribed() {
        return this.subscribed;
    }
    getOfferId() {
        return this.offerId;
    }
    getRequestId() {
        return this.requestId;
    }
    getError() {
        return this.error;
    }
    getType() {
        return MessageType.InstrumentSubscribingStatus;
    }
}
module.exports = InstrumentSubscribingStatusMessage
